import React from 'react';
import './NewStackButton.css';

interface NewStackButtonProps {
    onClick: () => void;
}

const NewStackButton: React.FC<NewStackButtonProps> = ({onClick}) => {
    return (
        // <button onClick={onClick} className="new-stack-button">
        //     Create new stack
        // </button>
        <button className="new-stack-button">
            Create new stack
        </button>
    )
}

export default NewStackButton;
